payload_browser (){
   # Takes 1 arg:       Arg 1 is pattern to search for among payload pathnames.
   #
   # This function finds, extracts, decodes and displays a file listing from
   # the standard HTK payload, for the user, to allow them to see what is
   # included therein.  The single optional argument allows the user to search
   # for a pattern to display from the payload.
   (echo "Here is a list of the files you requested to view from the payload:"
    echo "==================================================================="
    echo "               (Tap the Q key to exit.)"
 
   yolk_2_stdout $MPLD $0 |tar -ztf - --wildcards \*$1\* ) 2>$DN| less
}
payload_extractor (){
   # Takes 1 arg:       Arg 1 is an optional pattern to search for among
   #                    payload pathnames.  
   #
   # This function finds, extracts, decodes and displays files and directories
   # from the standard HTK payload, for the user, to allow them to explore what
   # is included therein.  The single optional argument allows the user to
   # search for a pattern to extract from the payload.
   local MYTMP=$(mktemp -d /tmp/htk.XXX)
   #
   #
   ########################## old code #########################################
   #############################################################################
   #yolk_2_stdout $MPLD $0 |tar -zxf - -C $MYTMP --wildcards \*$1\* 2>$DN
   #############################################################################
   ########################## old code #########################################
   #
   #
   extract_yolk_by_pattern_1__from__file_2 $MPLD $0 | \
      tar -zxf - -C $MYTMP --wildcards \*${1}\* 2>$DN
