# Mon Mar  1 04:13:55 MST 2010
# 1. Changed default hyper_sync options to behave more as expected for sync.
#    This includes making the sync functionality a bit slower, for the benefit
#    of data assurance and space.
# --inplace     -> Assure that files are overwritten instead of a copy being
#                  sent and then moved into place.
#
#                  Note that if a sync is interrupted with this option, then
#                  the resulting files will be in a corrupted state!
#
#                  The way to assure complete sync is to let the sync complete.
#
# -H    --> Assure the hardlinks get recreated as applicable
# -I    --> Assure that rsync delta-algorythm is used on ALL files
# -A    --> Assure that ACLs are preserved.
# -X    --> Assure that extended attributes are preserved
# -a    --> Archive mode means the following:
#           -r, --recursive             Recursive
#           -l, --links                 Preserve symlinks
#           -p, --perms                 Preserve perms
#           -t, --times                 Preserve mod times
#           -g, --group                 Preserve group
#           -o, --owner                 Preserve owner (super-user only)
#           -D                          Preserve device and special files
# -bkh
